import "./emptyclass.css"
import { useNavigate } from "react-router-dom"
import Building from "./building/building";
import axios from "axios";
const emptyclass = () => {
    const navigate = useNavigate();
    function emptyHandler() {
        navigate("/home/")
    }
    axios({
        method: "get",
        url: "/api/empty_room",
        headers: {
            "Content-Type": "multipart/form-data",
            "traefik": "jwzx",
        },
    }).then(res => {
        console.log(res);
    }, err => {
        console.log(err)
    });
    return (
        <div id="empty-bg" >
            <div id="emphead">
                <button id="empbtn" onClick={emptyHandler}><img src={require("./emptypic/returnarrow.png")} id="emparr" /></button>
                空闲教室
            </div>
            {['1f', '2f', '3f', '4f', '5f'].map((floor, index) => (
                <div id={`emptychoice${index + 1}`} style={{ display: index === 0 ? 'block' : 'none' }}>
                    <div className="floordiv" id={`f${index + 1}div`}><img src={require(`./emptypic/${floor}.jpg`)} id={`f${index + 1}`} className="buildingpic" /></div>
                </div>
            ))}
            <div id="classchoice">
                <div id="building">
                    {['二教', '三教', '四教', '五教', '八教'].map((building, index) => (
                        <div className="buildingbtndiv">
                            <button id={`btnb${index + 2}`} className="buildingbtn" onClick={() => {
                                for (let i = 1; i <= 5; i++) {
                                    document.getElementById(`emptychoice${i}`).style.display = i === index + 1 ? 'block' : 'none';
                                }
                            }}>{building}</button>
                        </div>
                    ))}
                </div>
            </div>
        </div>
      )
}
export default emptyclass;
